import React from "react";
import Python from "../images/python.jpeg";
import C from "../images/c++.png";

const main = () => {
  return (
    <div className="h-400 bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl py-8 font-bold">SKILLS</h1>
      </div>

      <div className="flex flex-col  ">
        <div className="bg-green-400 flex  m-10 border-2 rounded-xl p-8 h-80 uppercase font-bold  md:w-1/3">
          programming languages
          <div>
            <img className="w-24 rounded-full" src={Python} alt="py-logo" />
            python
          </div>
          <div>
            <img className="w-24" src={C} alt="" srcset="" />
          </div>
        </div>
        <div className="bg-green-400 m-10 border-2 rounded-xl p-8 uppercase font-bold  h-80 md:w-1/3">
          Front-End
        </div>
        <div className="bg-green-400 m-10 border-2 roundedrounded-xl p-8 h-80 uppercase font-bold md:w-1/3">
          back-end
        </div>
      </div>
    </div>
  );
};

export default main;
